import React from "react";
import renderLineChart from "./Graph";

function Dashboard() {
  return (
    <>
      <div className="incExpenses">
        Income and Expenses
        <renderLineChart>{renderLineChart}</renderLineChart>
      </div>
      <div className="savings">savings</div>
      <div className="spent">spent</div>
      <div className="displayIncExpenses">inc expenses</div>
    </>
  );
}

export default Dashboard;
